const generatePDF = (company, invoiceInfo) => {
  let company_logo = {
    w: 70,
    h: 30,
  };
  const unique = [...new Set(company.locate.map((item) => item.address.label))];

  let comapnyJSON = {
    CompanyName: capitalizeFirstLetter(
      String(company.basicinformation.cmpname)
    ),
    CompanyGSTIN: "37B76C238B7E1Z5",
    CompanyState: "KERALA (09)",
    CompanyPAN: "B76C238B7E",
    CompanyAddressLine1: "ABCDEFGD HOUSE,IX/642-D",
    CompanyAddressLine2: "ABCDEFGD P.O., NEDUMBASSERY",
    CompanyAddressLine3: "COCHIN",
    PIN: "683584",
    companyEmail: String(company.basicinformation.cmpemail),
    companyPhno: String(company.basicinformation.cmpphone),
  };

  let customer_BillingInfoJSON = {
    CustomerName: "Jidfdno dfdfgsv",
    CustomerGSTIN: "37B76C238B7E1Z5",
    CustomerState: "dsfdsfdsf (09)",
    CustomerPAN: "B76C238B7E",
    CustomerAddressLine1: unique,
    CustomerAddressLine2: "sdf P.O., sdfsdfs",
    CustomerAddressLine3: "COCHIN",
    PIN: "683584",
    CustomerEmail: String(company.basicinformation.cmpemail),
    CustomerPhno: String(company.basicinformation.cmpphone),
  };

  let invoiceJSON = {
    InvoiceNo: invoiceInfo.id,
    InvoiceDate: moment(invoiceInfo.paymentDate).format("L"),
    RefNo: "REF-78445",
    TotalAmnt: String(invoiceInfo.paymentAmount),
    SubTotalAmnt: "$ 30",
  };
  let imgData =
    "data:image/png;base64,";
  let fontSizes = {
    HeadTitleFontSize: 18,
    Head2TitleFontSize: 16,
    TitleFontSize: 14,
    SubTitleFontSize: 12,
    NormalFontSize: 10,
    SmallFontSize: 8,
  };
  let lineSpacing = {
    NormalSpacing: 12,
  };

  let doc = new jsPDF("p", "pt");
  // let rightStartCol1 = 400;
  // let rightStartCol2 = 480;
  let startX = 40;
  let InitialstartY = 50;
  let startY = 0;
  doc.setFontSize(fontSizes.SubTitleFontSize);
  doc.setFont("helvetica");
  doc.setFont(undefined, "bold");
  doc.addImage(
    imgData,
    "JPEG",
    startX,
    (startY += 50),
    company_logo.w,
    company_logo.h
  );
  doc.text(
    comapnyJSON.CompanyName,
    startX,
    (startY += 15 + company_logo.h),
    "left"
  );
  let tempY = InitialstartY;
  doc.setFont(undefined, "bold");
  doc.text("INVOICE NO: ", 350, (tempY += lineSpacing.NormalSpacing));
  doc.setFont(undefined, "normal");
  doc.text(invoiceJSON.InvoiceNo, 430, tempY);
  doc.setFont(undefined, "bold");
  doc.text("INVOICE Date: ", 350, (tempY += lineSpacing.NormalSpacing));
  doc.setFont(undefined, "normal");
  doc.text(invoiceJSON.InvoiceDate, 435, tempY);
  doc.text("Total.$: ", 350, (tempY += lineSpacing.NormalSpacing));
  doc.setFont(undefined, "normal");
  doc.text(invoiceJSON.TotalAmnt, 430, tempY);
  doc.setFont(undefined, "normal");
  doc.setFontSize(fontSizes.Head2TitleFontSize);
  doc.setFont(undefined, "bold");

  doc.setFontSize(fontSizes.NormalFontSize);
  doc.setFont(undefined, "bold");

  //-------Customer Info Billing---------------------

  doc.setFont(undefined, "bold");
  doc.text("Email:", startX, (startY += lineSpacing.NormalSpacing));
  doc.setFont(undefined, "normal");
  doc.text(customer_BillingInfoJSON.CustomerEmail, 80, startY);
  doc.setFont(undefined, "bold");
  doc.text("Phone: ", startX, (startY += lineSpacing.NormalSpacing));
  doc.setFont(undefined, "normal");
  doc.text(customer_BillingInfoJSON.CustomerPhno, 80, startY);
  doc.setFontSize(fontSizes.NormalFontSize);
  doc.setFont(undefined, "bold");
  doc.text("Location:", startX, (startY += lineSpacing.NormalSpacing));
  doc.setFont(undefined, "normal");
  doc.text(customer_BillingInfoJSON.CustomerAddressLine1, 90, startY);

  doc.setFontSize(8);
  doc.setFont(undefined, "normal");

  // doc.autoTable(columns, rows, options);
  // autoTable(doc, { html: "#my-table" });

  // Or use javascript directly:
  var packages2 = [
    invoiceInfo.id,
    invoiceInfo.paymentAmount,
    invoiceInfo.paidPackage,
    invoiceInfo.status,
    moment(invoiceInfo.paymentDate).format("L"),
    moment(invoiceInfo.packageEndDate).format("L"),
  ];
  autoTable(doc, {
    head: [
      [
        "Payment Id",
        "Amount",
        "Package",
        "Status",
        "Payment Date",
        "Package End Date",
      ],
    ],
    body: [packages2],
    margin: {
      top: 50,
    },
    startY: (startY += 50),
  });
  //-------Invoice Footer---------------------
  const rightcol1 = 340;
  const rightcol2 = 430;

  startY = doc.autoTableEndPosY() + 30;
  doc.setFontSize(fontSizes.NormalFontSize);
  doc.setFont(undefined, "bold");
  doc.text("Grand Total $.", rightcol1, (startY += lineSpacing.NormalSpacing));
  doc.setFont(undefined, "normal");
  doc.text(invoiceJSON.TotalAmnt, rightcol2 + 25, startY);
  doc.setFont(undefined, "bold");
  doc.text(
    "For " + comapnyJSON.CompanyName + ",",
    rightcol2,
    (startY += lineSpacing.NormalSpacing + 25)
  );
  doc.text(
    "Authorised Signatory",
    rightcol2,
    (startY += lineSpacing.NormalSpacing + 25)
  );
  doc.save("Invoice.pdf");
};

